    body: "\r\nReact version: 18.2.0\r\n\r\n## Steps To Reproduce\r\n\r\nI have two independent project : main and features project.  Features project have side effect components: CustomerSearch, UserSearch, AccountSearch, etc and i'm using in main project these.\r\n\r\nBut UserSearch component needs StoreProvider, MessageProvider, ThemeProvider or any provider in main project. And I decided using createPortal.\r\n\r\nUserSearch.tsx in features project:\r\n```\r\nexport const FibaUserSearch = <\r\n  TFieldValues extends FieldValues = Record<string, string | User>,\r\n  TName extends FieldPath<TFieldValues> = FieldPath<TFieldValues>,\r\n>(\r\n  props: UserSearchProps<TFieldValues, TName>,\r\n) => createPortal(<FibaUserSearchInner {...props} />, document.getElementById('container')) \r\n```\r\n\r\nindex.tsx in main project\r\n```\r\n return (\r\n    <>\r\n      <ThemeProvider theme={createTheme(theme, ...muiThemeLang[languageProfile])}>\r\n        <NotificationProvider>\r\n          <LayoutProvider>\r\n            <MessageProvider>\r\n              <Container id=\"container\">\r\n                <Header />\r\n                <FibaBox\r\n                  sx={{\r\n                    p: `${toolbarHeight ?? 0}px 10px 0px 10px`,\r\n                  }}\r\n                >\r\n                 <FibaUserSearch/>\r\n                </FibaBox>\r\n              </Container>\r\n            </MessageProvider>\r\n          </LayoutProvider>\r\n        </NotificationProvider>\r\n      </ThemeProvider>\r\n      <Loading />\r\n    </>\r\n  )\r\n```\r\n\r\nMy expectation is that every provider in index.tsx is available for FibaUserSearch. But createPortal doesn't work this case or I didn't understand logic clearly.\r\n\r\nThanks,",
